import React from 'react';
import PropTypes from 'prop-types';

import './StickyInfo.css';

export default function StickyInfo({groups, isFavorite, onFavoriteSelected, leastFavoritesExplanation, mediums, story}) {
  return (
    <>
      <Mediums mediums={mediums} />
      <Groups groups={groups} />
      {leastFavoritesExplanation && (<div>It's a least favorite because: {leastFavoritesExplanation}</div>)}
      <p>{story}</p>
      <button
        className="wallView-favoriteButton"
        onClick={onFavoriteSelected}
      >
        {isFavorite ? 'favorited!' : 'Mark as your favorite'}
      </button>
    </>
  );
}

StickyInfo.propTypes = {
  children: PropTypes.node.isRequired,
};
